import Axios from 'axios';

const instance = Axios.create({
    withCredentials: true,
    baseURL: 'http://localhost:4000/api/'
});


export const userApi = {
    getMainSliderImgs() {
        return {images: [{url: 'https://images.unsplash.com/photo-1503376780353-7e6692767b70?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&w=1000&q=80'}]}
    }
}
